import React, { useState } from "react";
import Food1 from "../images/f1.png"
import Food2 from "../images/f2.png";
import Food3 from "../images/f3.png";
import Food4 from "../images/f4.png";
import Food5 from "../images/f5.png";
import Food6 from "../images/f6.png";
import Food7 from "../images/f7.png";
import Food8 from "../images/f8.png";
import Food9 from "../images/f9.png";

const FoodSection = () => {
const [filter, setFilter] = useState ("all");  
  const foodMenu = [
    {
      id: 1,
      category: "pizza",
      name: "Delicious Pizza",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$20",
      image: Food1,
    },
    {
      id: 2,
      category: "burger",
      name: "Delicious Burger",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$15",
      image: Food2,
    },
    {
      id: 3,
      category: "pizza",
      name: "Delicious Pizza",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$17",
      image: Food3,
    },
    {
      id: 4,
      category: "pasta",
      name: "Delicious Pasta",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$18",
      image: Food4,
    },
    {
      id: 5,
      category: "fries",
      name: "French Fries",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$10",
      image: Food5,
    },
    {
      id: 6,
      category: "fries",
      name: "French Fries",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$10",
      image: Food6,
    },
    {
      id: 7,
      category: "fries",
      name: "French Fries",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$10",
      image: Food7,
    },
    {
      id: 8,
      category: "fries",
      name: "French Fries",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$10",
      image: Food8,
    },
    {
      id: 9,
      category: "fries",
      name: "French Fries",
      description:
        "Veniam debitis quaerat officiis quasi cupiditate quo, quisquam velit, magnam voluptatem repellendus sed eaque",
      price: "$10",
      image: Food9,
    },
  ];

  // Filtered items based on selected category
  const filteredMenu =
    filter === "all"
      ? foodMenu
      : foodMenu.filter((item) => item.category === filter);

  return (
    <section className="food_section layout_padding-bottom">
      <div className="container">
        <div className="heading_container heading_center">
          <h2>Our Menu</h2>
        </div>

        {/* Filters */}
        <ul className="filters_menu">
          {["all", "burger", "pizza", "pasta", "fries"].map((category) => (
            <li
              key={category}
              className={filter === category ? "active" : ""}
              onClick={() => setFilter(category)}
            >
              {category.charAt(0).toUpperCase() + category.slice(1)}
            </li>
          ))}
        </ul>

        {/* Food Items */}
        <div className="filters-content">
          <div className="row grid">
            {filteredMenu.map((item) => (
              <div
                key={item.id}
                className={`col-sm-6 col-lg-4 all ${item.category}`}
              >
                <div className="box">
                  <div>
                    <div className="img-box">
                      <img src={item.image} alt={item.name} />
                    </div>
                    <div className="detail-box">
                      <h5>{item.name}</h5>
                      <p>{item.description}</p>
                      <div className="options">
                        <h6>{item.price}</h6>
                        <a href="#">
                          <i className="fa fa-shopping-cart"></i>
                        </a>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* View More Button */}
        <div className="btn-box">
          <a href="#">View More</a>
        </div>
      </div>
    </section>
  );
};

export default FoodSection;
